import React from "react";
import './Sidebar.scss';
type SidebarProps = {
  title: string,
  titleLink: string
}

const Sidebar = ({ title, titleLink }: SidebarProps) => {

  return (
    <>
      <div className="sidebar">
        <div className="sidebar-logo">
          <a href={titleLink}>{title}</a>
        </div>
      </div>
    </>
  )
}

export default Sidebar;
